import React, { Component } from 'react';
import './App.css';
import Movie from './Movie';


var movieImg = [
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSznEBCx57B7rkIm5vp3X1onCKUWtqKv7jLbA&usqp=CAU",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  'data:image/jpeg;base64,'
]

class App extends Component {

  // Render 순서 : componentWillMount() >> render() >> componetDidMount()
  // 

  state = {
  }

  componentWillMount() {
    console.log('will.mount');
  }
  
  // Timer
  componentDidMount(){
    console.log('did.mount');
    setTimeout(() => {
      this.setState({
        movieInfo: [
          {
            //id: 1,
            title: 'league of lengends Movie',
            poster: movieImg[0]
          },
          {
            //id: 2,
            title: 'us',
            poster: movieImg[1]
          },
          {
            //id: 3,
            title: '300',
            poster: movieImg[2]
          },
          {
            //id: 4,
            title: 'train to busan',
            poster: movieImg[3]
          },
          {
              title: 'soul',
            poster: movieImg[4]
          }
        ]
      })
    }, 5000);
  }
  
  // = () =>
  // 이거는 
  _renderMovies = () => {
    var movies = this.state.movieInfo.map((movie, index) => {
      // key값 정하기
      // map의 기능 중 하나인 index를 사용해서 key값을 정하는 것
      // movieInfo에 고유 id값을 정하는 것
      return <Movie title={movie.title} poster={movie.poster} key={index} />;
    });
    return movies;
   }
  
  render() { 
    return (
      <div className="App">
        {this.state.movieInfo ? this._renderMovies(): 'Loading...'}
      </div>
    );
  }
}

export default App;
